  true,\n\t\"url\": null,\n\t\"notes\": \"The Height and Bulk Districts are a component
  of the Zoning Map which in turn is a key component of the San Francisco Planning
  Code.  The data is available in GIS Shapefile format.  The .dbf file can be opened
  in Excel, Access or other spreadsheet or database programs.The Zoning Map comprises:-
  Zoning Districts- Height and Bulk Districts- Special Use Districts- Preservation
  Districts- Coastal Zone Area- Special Sign DistrictsThe official Zoning Map can
  be found in the San Francisco Planning Code:http://planningcode.sfplanning.org (click
  on the links under ZONING MAPS on the left navigation column).\",\n\t\"license_title\":
